sourcesContent:
require('dotenv').config();
import nodemailer from 'nodemailer';

let sendSimpleEmail = async (dataSend) => {
    console.log("Nguoi nhan: ", dataSend.reciverEmail);
    let transporter = nodemailer.createTransport({
        host: "smtp.gmail.com",
        port: 587,
        secure: false, // true for 465, false for other ports
        auth: {
            user: process.env.EMAIL_APP, // generated ethereal user
            pass: process.env.EMAIL_APP_PASSWORD, // generated ethereal password
        },
    });


    let info = await transporter.sendMail({
        from: '"HEALTH" <maithu1801tv@gmail.com>',
        to: dataSend.reciverEmail, // email nguoi nhan
        subject: 'Thng tin t lch khm bnh',// tiu 
        html: getBodyHTMLEmail(dataSend),
    });

}

let getBodyHTMLEmail = (dataSend) => {
    let result = ''
    if (dataSend.language === 'vi') {
        result = `
        <h3>Xin cho ${dataSend.patientName}</h3>
        <p>Bn nhn c email ny v  t lch khm bnh online trn Health</p>
         <p>Thng tin t lch khm bnh: </p>
        <div><b>Thi gian: ${dataSend.time}</b></div>
        <div><b>Bc s: ${dataSend.doctorName}</b></div>

        <p>Nu thng tin trn l ng s tht vui lng click vo ng dn 
         xc nhn v hon thnh th tc t lch khm bnh</p>
        <div>
        <a href=${dataSend.redirectLink} target="_blank">Click here</a>
        </div>

        <div>Xin chn thnh cm n</div>
        
        `
    }
    if (dataSend.language === 'en') {
        result = `<h3>Dear ${dataSend.patientName}</h3>
        <p>You received this email because you booked an online medical appointment on Health</p>
         <p>Information to schedule an appointment:</p>
        <div><b>Time: ${dataSend.time}</b></div>
        <div><b>Doctor: ${dataSend.doctorName}</b></div>

        <p>If the above information is correct, please click on the link
        to confirm and complete the medical appointment booking procedure</p>
        <div>
        <a href=${dataSend.redirectLink} target="_blank">Click here</a>
        </div>

        <div>Sincerely thank</div>
        
        `
    }
    return result;
}



module.exports = {
    sendSimpleEmail: sendSimpleEmail,
}
